                            item: out LeveledFlag FlagsParse,
                            errorMask: errorMask))
                        {
                            item.Flags = FlagsParse;
                        }
                        else
                        {
                            item.Flags = default(LeveledFlag);
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Entries":
                    try
                    {
                        errorMask?.PushIndex((int)LeveledItem_FieldIndex.Entries);
                        if (ListXmlTranslation<LeveledEntry<ItemAbstract>>.Instance.Parse(
                            node: node,
                            enumer: out var EntriesItem,
                            transl: LoquiXmlTranslation<LeveledEntry<ItemAbstract>>.Instance.Parse,
                            errorMask: errorMask,
                            translationMask: translationMask))
                        {
                            item.Entries.SetTo(EntriesItem);
                        }
                        else
                        {
                            item.Entries.Unset();
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                default:
                    ItemAbstractXmlCreateTranslation.FillPublicElementXml(
                        item: item,
                        node: node,
                        name: name,
                        errorMask: errorMask,
                        translationMask: translationMask);
                    break;
            }
        }

    }

